import React, { Component } from "react";
import { Link } from "react-router-dom";
import Like from "./like";
import { getAdvisee } from "../service/userService";
import auth from "../service/authService";

class AdviseeTableBody extends Component {
  constructor(props) {
    super(props);
    console.log("advisee table body props = " + props);
  }
  componentDidMount() {}
  render() {
    const { advisees } = this.props; //this.props.people
    //const { user } = this.props.user;
    const user = auth.getCurrentUser();
    console.log(user);
    console.log(advisees);
    var a1 = advisees[1];
    console.log(a1);

    //console.log(getAdvisee(user._doc._id, advisees[1]));
    return (
      <tbody>
        {advisees.map((advisee, index) => (
          <tr key={index}>
            <td>{advisee.lName}</td>
            <td>{advisee.fName}</td>
            <td>
              <Link to={`/student`}> {advisee.studentID} </Link>
            </td>
          </tr>
        ))}
      </tbody>
    );
  }
}

// ${advisee.studentID}

export default AdviseeTableBody;
